def rotate_n(facedir, n):
    n2 = 0
    for i in range(24):
        if n&(1<<i):
            side, index = i//4, i%4
            pside = get_pointed_side(side, index)
            nside = rotate_side(facedir, side)
            npside = rotate_side(facedir, pside)
            nindex = get_pointed_index(nside, npside)
            n2 |= (1<<(4*nside+nindex))
    return n2

def is_valid(n):
    sides_connected = [False]*6
    for side in range(6):
        mask = 15<<(4*side)
        sides_connected[side] = (mask&n != 0)
    for side in range(6):
        if sides_connected[side]:
            for index in range(4):
                pside = get_pointed_side(side, index)
                if sides_connected[pside] and (n&(1<<(4*side+index))==0):
                    return False
    return True

def n_to_sides(n):
    sides_connected = [False]*6
    for side in range(6):
        mask = 15<<(4*side)
        sides_connected[side] = (mask&n != 0)
    s = tuple([i for i in range(6) if sides_connected[i]])
    s2 = tuple([(i//4, get_pointed_side(i//4, i%4)) for i in range(24) if n&(1<<i)])
    return (s, s2)

def hash_sides(sides):
    n = 0
    for side in sides[0]:
        n += (1<<side)
    for connect in sides[1]:
        n += (1<<(6*connect[0]+connect[1]+6))
    return n

